import React from 'react'
import {TouchableOpacity,ImageBackground ,Image, StyleSheet, Text, View } from 'react-native'
//import 
const Panier = ({navigation}) => {
    return (
        <View>
            <ImageBackground
                source={require('../../App_Resources/iOS/background.png')}
                style={styles.background} >
                <Text>Voici la liste des produits de la semaine</Text>
                <View style={styles.block}>

                    <TouchableOpacity style={styles.combImgText}
                    onPress = {()=>{
                      this.props.navigation.navigate('Recettes');
                    }}>
                        <Image style={styles.image}
                        source={require('../../App_Resources/iOS/recette.png')} />
                        <Text style={styles.text}> Recettes</Text>
                    </TouchableOpacity>

                    <TouchableOpacity style={styles.combImgText}
                    onPress = {()=>{
                      this.props.navigation.navigate('Profil du gerant');
                    }}>
                        <Image style={styles.image}
                        source={require('../../App_Resources/iOS/tourteau.png')} />
                        <Text style={styles.text}> Contact</Text>
                    </TouchableOpacity>
                </View>

            </ImageBackground>
        </View>
    )
}

export default Panier

const styles = StyleSheet.create({
    block:{
    flex:1,
    flexDirection:'row',
    justifyContent : 'space-between',
    /*padding: "2%",*/

  },
  combImgText:{
    /*width:70,
    height:60,*/
    flexDirection:'row',
    backgroundColor: 'blue',
    borderRadius:1,
    flex:0.45
    /*position: 'relative',
    zIndex:2*/
  },
  text:{
     /*width: "100%", 
     height: "100%",*/
     textAlign:'center',
     paddingTop: 20,
     fontSize:15,
     paddingRight:10
     /*backgroundColor:"red"*/
  },
  image:{
    width:50,
    height: 50,
    borderColor:'50%',
    marginLeft:10,
    marginTop:10,
    marginBottom:10
  },
  background: {
    flex:1
  }
})
